import React from "react";
import lang from "../img/lang.svg"
import arrow from "../img/back.svg"

const SelectLang = function() {
    return (
        <div className="settings">
            <img src={lang} alt="Lang"/>
            <p>RU</p>
            <img src={arrow} alt="arrow"/>
        </div>

    )
}
export default SelectLang;
